import aliases from './aliases'
import { CSSObject, CACHE_PROPS } from './types'
import { OptionsProps, PropMediaType } from './types'
export * from './types'
const isObject = (v: any) => typeof v === "object" && !Array.isArray(v);
const uid = () => Math.random().toString(36).substring(2, 8);
const CACHE = new Map<string, CACHE_PROPS>();

const formatePropName = (name: string) =>
  name
    .split(/(?=[A-Z])/)
    .join("-")
    .toLowerCase();


const val_formate = (val: any, key: string) => {
  if (!isNaN(val) && !(key === "font-weight" || key === "line-height")) {
    val = `${val}px`;
  }
  return val
}



const make_css = (_css: Partial<CSSObject>, id?: string, cls?: string, tag?: any, cache_key?: string, options?: OptionsProps) => {
  if (!id) {
    id = id || (options?.classPrefix || "css-") + uid();
    cache_key = JSON.stringify(_css);
    const cache = CACHE.get(cache_key);
    if (cache) {
      return { id: cache.id, cache_key };
    }
    CACHE.set(cache_key, {
      id
    });

    if (!tag) {
      tag = document.createElement("style");
      document.head.append(tag);
    }
  }
  cls = cls || id;
  let medias: PropMediaType = {}
  const props: Partial<{ [key in keyof CSSObject]: string }> = {}
  for (let key in _css) {
    let val = (_css as any)[key];

    if (options?.getProp) {
      const is = options.getProp(key, val)
      if (!is) {
        continue;
      }
    }

    if (isObject(val)) {
      if (options?.breakpoints) {
        const breakpoints = options.breakpoints
        if (Object.keys(breakpoints).includes(Object.keys(val)[0])) {
          // create media
          for (let bpname in val) {
            const bpnum = options.breakpoints[bpname]
            if (bpnum) {
              let bpval = val[bpname]
              key = formatePropName(key)
              bpval = val_formate(bpval, key)
              let oldClsProps = medias[bpnum] && medias[bpnum][cls]
              medias[bpnum] = {
                ...(medias[bpnum] || {}),
                [cls]: {
                  ...(oldClsProps || {}),
                  [key]: bpval
                } as CSSObject
              }
            }
          }
          continue
        }
      }
      make_css(val, id, key.replace("&", cls), tag, cache_key, options);
    } else {
      const aliasesList = (options?.getAliases && options?.getAliases(aliases)) || aliases
      let alias = (aliasesList as any)[key];
      if (typeof alias === "function") {
        const alisa_ob = alias(val, key)
        for (let askey in alisa_ob) {
          let asval = (alisa_ob as any)[askey]
          askey = formatePropName(askey)
          asval = val_formate(asval, askey)
          props[askey] = `${askey}: ${asval}`
        }
      } else {
        key = formatePropName(alias || key)
        val = val_formate(val, key)
        props[key] = `${key}: ${val}`
      }
    }
  }
  console.log(medias);

  tag.innerHTML += `.${cls}{${Object.values(props).join(";")}}`;
  return { cache_key: cache_key as string, id };
};


export const css = (_css: Partial<CSSObject>, options?: OptionsProps) => {
  const { id } = make_css(_css, undefined, undefined, undefined, undefined, options)
  return id
};
